        "effect_ko": "이 포켓몬과 접촉할 때마다, 이 포켓몬의 사용자는 화상을 입을 확률이 30%입니다.\n\n오버월드: 파티에 있는 포켓몬 중 이 능력을 가진 포켓몬이 있다면, 파티의 각 알은 각 단계마다 해치 카운터가 1개가 아닌 2개씩 줄어들어 알이 약 두 배 더 빨리 부화합니다. 여러 포켓몬이 이 능력을 가지고 있거나 마그마 갑옷을 가지고 있다면 이 효과는 쌓이지 않습니다.",
