        "effect_ko": "이 포켓몬의 추가 효과는 1.3배의 힘을 가지지만 추가 효과는 사라집니다.\n\n효과 확률은 움직임의 주요 효과 외에도 상태 장애를 일으키거나, 스탯 변화를 일으키거나, 목표물을 움찔하게 만들 수 있는 기회입니다. 예를 들어, 천둥 충격파의 마비는 추가적인 효과이지만, 천둥 파동의 마비는 그렇지 않으며, 노크오프의 아이템 제거와 에어 커터의 임계 적중률도 증가하지 않습니다.\n\n사용자의 통계를 낮추는 움직임은 영향을 받지 않습니다.",
