        "effect_ko": "전투에서 이 포켓몬은 보유한 아이템을 사용할 수 없으며, 그 아이템이 전투에 긍정적이든 부정적이든 수동적인 영향을 미치지 않습니다. 이 포켓몬은 또한 플링을 사용할 수 없습니다.\n\n철공의 속도 컷과 노력 아이템(마초 브레이스, 파워 웨이트, 파워 브레이서, 파워 벨트, 파워 렌즈, 파워 밴드, 파워 발찌)은 영향을 받지 않습니다. 전투에 직접적인 영향을 미치지 않는 아이템들, 예를 들어 엑스퍼트 점유율, 부적 동전, 또는 진정 벨은 평소와 같이 작동합니다. 보유된 모든 아이템은 전투 외에도 정상적으로 작동합니다.\n\n보유한 아이템을 사용하는 다른 동작들, 예를 들어 자연 선물이나 스위처루는 평소와 같이 작동합니다",
