        "effect_ko": "이 포켓몬이 사용하거나 반대하는 움직임은 절대 놓치지 않습니다.\n\n일회성 KO 동작은 영향을 받지 않습니다. 이 능력에 영향을 받은 동작은 파거나 날기와 같은 동작 준비 과정에서 포켓몬을 공격할 수 있습니다.\n\n오버월드: 주인공 포켓몬이 이 능력을 가지고 있다면, 야생 조우율이 두 배로 증가합니다",
